import homeStiles from "./Home.module.css";
import { NavLink } from "react-router-dom";
import Slider from "../Slider/Slider";
import hoveStyles from "./Home.module.css";
import data from "../../utils/data";
import Card from "../Card/Card";
export default function Home() {
  return (
    <div>
      <Slider />
      <p className={hoveStyles.text}>PARKS AND RECREATION</p>
      <NavLink className={homeStiles.link}>SHOP NEW</NavLink>
      <div className={homeStiles.photosBox}>
        <div className={homeStiles.photoBox}>
          {data.map((obj) => {
            if (obj.id <= 2) {
              return (
                <img
                  className={homeStiles.img}
                  src={obj.image}
                  alt={obj.name}
                ></img>
              );
            }
          })}
        </div>
      </div>
      <div className={homeStiles.bar}></div>
      {data.map((obj) => {
        if (obj.id <= 4) {
          return (
            <div>
              <Card className={homeStiles.card} key={obj.image} {...obj}></Card>
            </div>
          );
        }
      })}
    </div>
  );
}
